import './App.scss';
import Comp1 from './Component/Comp1';
import Comp2 from './Component/Comp2';

import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <Router>
      <>
        <Routes>
          <Route path="/comp1">
            <Comp1 />
          </Route>
          <Route path="/comp2">
            <Comp2 />
          </Route>
        </Routes>
      </>
    </Router>
  );
}

export default App;
